// src/components/Navbar.js
import React from "react";
import { Link } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

export default function Navbar() {
  const { isAuthenticated, login, logout, account } = useAuth();

  return (
    <nav style={{ padding: "1rem", background: "#f0f0f0" }}>
      <Link to="/" style={{ marginRight: "1rem" }}>Home</Link>
      <Link to="/search" style={{ marginRight: "1rem" }}>Search</Link>

      {isAuthenticated && (
        <>
          <Link to="/profile" style={{ marginRight: "1rem" }}>Profile</Link>
          <Link to="/bookmarks" style={{ marginRight: "1rem" }}>Bookmarks</Link>
        </>
      )}

      {!isAuthenticated ? (
        <button onClick={login} style={{ marginLeft: "1rem" }}>Login</button>
      ) : (
        <>
          <span style={{ marginLeft: "1rem" }}>Hi, {account?.name}</span>
          <button onClick={logout} style={{ marginLeft: "1rem" }}>Logout</button>
        </>
      )}
    </nav>
  );
}
